        private void butDispaly_Click(object sender, EventArgs e)
        {
          
            unsafe
            {
                byte* pData = (byte*)globleVariables.g_pBuffer;
                for (int i = 0; i < 64 * 1024; i++)
                {
                    globleVariables.g_chADataArray[i] = *(pData + i * 2);      // 通道A的数据在原始缓冲区里的标号是0，2，4，6，8...
                    globleVariables.g_chBDataArray[i] = *(pData + i * 2 + 1);  // 通道B的数据在原始缓冲区里的标号是1，3，5，7，9...
                }
            }
            pictureBox_chA.Invalidate();
            pictureBox_chB.Invalidate();

            // 第二个设备
            if (globleVariables.g_OSCcnt >= 2)
            {
                unsafe
                {
                    byte* pData = (byte*)globleVariables.g_pBuffer_2nd;
                    for (int i = 0; i < 64 * 1024; i++)
                    {
                        globleVariables.g_ch5DataArray[i] = *(pData + i * 2);      // 通道C的数据在原始缓冲区里的标号是0，2，4，6，8...
                        globleVariables.g_ch6DataArray[i] = *(pData + i * 2 + 1);  // 通道D的数据在原始缓冲区里的标号是1，3，5，7，9...
                    }
                }
                pictureBox_ch5.Invalidate();
                pictureBox_ch6.Invalidate();
            }

            // 第三个设备
            if (globleVariables.g_OSCcnt >= 3)
            {
                unsafe
                {
                    byte* pData = (byte*)globleVariables.g_pBuffer_3rd;
                    for (int i = 0; i < 64 * 1024; i++)
                    {
                        globleVariables.g_ch9DataArray[i] = *(pData + i * 2);      // 通道5的数据在原始缓冲区里的标号是0，2，4，6，8...
                        globleVariables.g_ch10DataArray[i] = *(pData + i * 2 + 1);  // 通道6的数据在原始缓冲区里的标号是1，3，5，7，9...
                    }
                }

                pictureBox_ch9.Invalidate();
                pictureBox_ch10.Invalidate();
            }

            // 第四个设备
            if (globleVariables.g_OSCcnt >= 4)
            {
                unsafe
                {
                    byte* pData = (byte*)globleVariables.g_pBuffer_4th;
                    for (int i = 0; i < 64 * 1024; i++)
                    {
                        globleVariables.g_ch13DataArray[i] = *(pData + i * 2);      // 通道5的数据在原始缓冲区里的标号是0，2，4，6，8...
                        globleVariables.g_ch14DataArray[i] = *(pData + i * 2 + 1);  // 通道6的数据在原始缓冲区里的标号是1，3，5，7，9...
                    }
                }

                pictureBox_ch13.Invalidate();
                pictureBox_ch14.Invalidate();
            }
        }

